import * as React from "react"
import DataSelection from "./DataSelection";
import { createTheme } from '@mui/material';

function App() {
  const darktheme = createTheme({
    palette: {
      type: "dark"
    }
  })

  return (
    <RootStyle theme={darktheme}>
      <DataSelection />
    </RootStyle>

    );
}

export default App;
